// Sidebar imports
import {
    UilEstate,
    UilClipboardAlt,
    UilUsersAlt,
    UilPackage,
    UilChart,
    UilSignOutAlt,
} from "@iconscout/react-unicons";

// Analytics Cards imports
import { UilUsdSquare, UilMoneyWithdrawal } from "@iconscout/react-unicons";

// Sidebar Data
export const SidebarData = [
    {
        icon: UilUsersAlt,
        heading: "Profile",
    },
    {
        icon: UilClipboardAlt,
        heading: "Dashboard",
    },
    {
        icon: UilUsersAlt,
        heading: "X",
    },
    {
        icon: UilPackage,
        heading: 'Y'
    },
    {
        icon: UilChart,
        heading: 'Z'
    },
];

// Analytics Cards Data
export const cardsData = [
    {
        title: "CODEFORCES",
        color: {
            backGround: "linear-gradient(180deg, #bb67ff 0%, #c484f3 100%)",
            boxShadow: "0px 10px 20px 0px #e0c6f5",
        },

        img: {
            Image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fdev.to%2Fipreda%2Fcodeforces-how-to-use-typescript-javascript-like-a-pro-1cjo&psig=AOvVaw1-aaZitcUN3JFaTKT5TESD&ust=1681214551285000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCOip17Kin_4CFQAAAAAdAAAAABAV",
        },

    },
    {
        title: "HACKERRANK",
        color: {
            backGround: "linear-gradient(180deg, #FF919D 0%, #FC929D 100%)",
            boxShadow: "0px 10px 20px 0px #FDC0C7",
        },

        png: UilMoneyWithdrawal,

    },
    {
        title: "HACKEREARTH",
        color: {
            backGround:
                "linear-gradient(rgb(248, 212, 154) -146.42%, rgb(255 202 113) -46.42%)",
            boxShadow: "0px 10px 20px 0px #F9D59B",
        },

        png: UilClipboardAlt,

    },
    {
        title: "CODECHEF",
        color: {
            backGround: "linear-gradient(180deg, #bb67ff 0%, #c484f3 100%)",
            boxShadow: "0px 10px 20px 0px #e0c6f5",
        },

        png: UilUsdSquare,

    },
    {
        title: "LEETCODE",
        color: {
            backGround: "linear-gradient(180deg, #bb67ff 0%, #c484f3 100%)",
            boxShadow: "0px 10px 20px 0px #e0c6f5",
        },

        png: UilUsdSquare,

    },
    {
        title: "TOPCODER",
        color: {
            backGround: "linear-gradient(180deg, #bb67ff 0%, #c484f3 100%)",
            boxShadow: "0px 10px 20px 0px #e0c6f5",
        },

        png: UilUsdSquare,

    },
    {
        title: "KICKSTART",
        color: {
            backGround: "linear-gradient(180deg, #bb67ff 0%, #c484f3 100%)",
            boxShadow: "0px 10px 20px 0px #e0c6f5",
        },

        png: UilUsdSquare,

    },
];
